          </Typography> */}

        <List component="nav">
          <ListItem>
            <ListItemText secondary="Username" />
            {user.Username}
          </ListItem>
          <Divider />
          <ListItem divider>
            <ListItemText secondary="First Name" />
            {user.Fname}
          </ListItem>
          <ListItem divider>
            <ListItemText secondary="Last Name" />
            {user.Lname}
          </ListItem>
          <ListItem divider>
            <ListItemText secondary="Email id" />
            {user.Email}
          </ListItem>
          <ListItem divider>
            <ListItemText secondary="Joined" />
            {user.CreationDate}
